package com.Chapter3.com;

public class Compare {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 5;
		int b = 6;
		System.out.println("a>b是否成立:" + (a > b));
		System.out.println("a<b是否成立:" + (a < b));
		System.out.println("a=b是否成立:" + (a == b));
		System.out.println("a!=b是否成立:" + (a != b));
		System.out.println("a>=b是否成立:" + (a >= b));
		System.out.println("a<=b是否成立:" + (a <= b));
	}

}
